import React from 'react';
import {
  Button,
  InputGroup,
  InputGroupText,
  TextInput
} from '@patternfly/react-core';

export default class SearchBar extends React.Component {
    constructor(props) {
      super(props);
    }

    render() {
      return (

        <React.Fragment>

          <InputGroup>
            <TextInput name="textInput11" id="textInput11" type="search" aria-label="search input example" />
            <Button variant="primary" aria-label="search button for search input"  className='searchIcon'>
            <i class="fas fa-search fa-lg"></i>
            </Button>
          </InputGroup>
        </React.Fragment>
      );
    }
  }
